024-06-06T13:52:19.016816","status":"completed"},"tags":[]},"source":["Let's handle outliers using a method called 'interquartile range' (IQR). \n","\n","The IQR basically tells us the spread of the middle half of the data. We can then calculate upper and lower limits based on the IQR. Data points that fall significantly above the upper limit or below the lower limit are considered outliers. "]},{"cell_type":"code","execution_count":4,"id":"316da2e5","metadata":{"execution":{"iopub.execute_input":"2024-06-06T13:52:19.041559Z","iopub.status.busy":"2024-06-06T13:52:19.039772Z","iopub.status.idle":"2024-06-06T13:52:19.071974Z","shell.execute_reply":"2024-06-06T13:52:19.070104Z"},"papermill":{"duration":0.043798,"end_time":"2024-06-06T13:52:19.074565","exception":false,"start_time":"2024-06-06T13:52:19.030767","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["   Min. 1st Qu.  Median    Mean 3rd Qu.    Max. \n","   48.0    70.0    95.0   102.5   116.0   185.0 "]},"metadata":{},"output_type":"display_data"}],"source":["# Determine outlier boundaries by IQR method\n","find_outlier_boundary <- function(data, variable) {\n","  IQR <- IQR(data[, variable])  # Calculate IQR using IQR function\n","  lower_boundary <- quantile(data[, variable], 0.25) - (IQR * 1.5)\n","  upper_boundary <- quantile(data[, variable], 0.75) + (IQR * 1.5)\n","  return(c(upper_boundary, lower_boundary))  # Return upper and lower boundaries\n","}\n","\n","# Determine outlier boundaries for Car_Horsepower\n","boundaries <- find_outlier_boundary(df, \"Car_Horsepower\")\n","upper_boundary <- boundaries[1]\n","lower_boundary <- boundaries[2]\n","\n","# Replace outliers with upper or lower boundaries\n","df$Car_Horsepower <- ifelse(df$Car_Horsepower > upper_boundary, upper_boundary,\n","                            ifelse(df$Car_Horsepower < lower_boundary, lower_boundary, df$Car_Horsepower))\n","\n","# Summary after outlier handling\n","summary(df$Car_Horsepower)"]},{"cell_type":"markdown","id":"539b5d66","metadata":{"papermill":{"duration":0.006997,"end_time":"2024-06-06T13:52:19.088556","exception":false,"start_time":"2024-06-06T13:52:19.081559","status":"completed"},"tags":[]},"source":["After outlier handling, the maximum value of Car Horsepower has changed from 262.0 to 185.0. "]},{"cell_type":"markdown","id":"c82346b1","metadata":{"papermill":{"duration":0.006984,"end_time":"2024-06-06T13:52:19.102534","exception":false,"start_time":"2024-06-06T13:52:19.09555","status":"completed"},"tags":[]},"source":["# Model Training using Linear Regression"]},{"cell_type":"code","execution_count":5,"id":"c26e3755","metadata":{"execution":{"iopub.execute_input":"2024-06-06T13:52:19.121743Z","iopub.status.busy":"2024-06-06T13:52:19.119928Z","iopub.status.idle":"2024-06-06T13:52:19.175719Z","shell.execute_reply":"2024-06-06T13:52:19.1739Z"},"papermill":{"duration":0.067694,"end_time":"2024-06-06T13:52:19.178149","exception":false,"start_time":"2024-06-06T13:52:19.110455","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","Call:\n","lm(formula = Car_Price ~ Car_Horsepower, data = trainset)\n","\n","Residuals:\n","   Min     1Q Median     3Q    Max \n","-88.87 -22.48  -4.73  19.64 184.60 \n","\n","Coefficients:\n","               Estimate Std. Error t value Pr(>|t|)    \n","(Intercept)    -47.5193    11.1112  -4.277 3.27e-05 ***\n","Car_Horsepower   1.7224     0.1015  16.965  < 2e-16 ***\n","---\n","Signif. codes:  0 *** 0.001 ** 0.01 * 0.05 . 0.1   1\n","\n","Residual standard error: 46.18 on 158 degrees of freedom\n","Multiple R-squared:  0.6456,\tAdjusted R-squared:  0.6433 \n","F-statistic: 287.8 on 1 and 158 DF,  p-value: < 2.2e-16\n"]},"metadata":{},"output_type":"display_data"}],"source":["# We will do Linear Regression model training\n","\n","# We will set seed number (or random state in Python) for result reproducibility\n","set.seed(123)\n","\n","# Train-test data split before create a model for model testing and evaluation\n","# Since the dataset is relatively small, we will use 80% of the dataset for model learning\n","df_split = sample.split(df$Car_Price, SplitRatio = 0.8)\n","\n","# Train set and test set by ratio 0.8\n","trainset = subset(df,df_split==TRUE)\n","testset = subset(df,df_split==FALSE)\n","\n","# Train the model using linear regression\n","linear_regression <- lm(Car_Price ~ Car_Horsepower, data = trainset)\n","\n","# Show summary for model training results\n","summary(linear_regression)"]},{"cell_type":"markdown","id":"d08b8f06","metadata":{"papermill":{"duration":0.007276,"end_time":"2024-06-06T13:52:19.192903","exception":false,"start_time":"2024-06-06T13:52:19.185627","status":"completed"},"tags":[]},"source":["As we can see from the summary, Car_Horsepower is strong predictor for Car_Price, highlighted by *** in the summary. \n","\n","The coefficient for the model is Car_Price = -47.52 + 1.72 * Car_Horsepower.\n","\n","Based on Linear Regression model: \n","Every 1 increment from Car_Horsepower will increase Car_Price by 1.72"]},{"cell_type":"code","execution_count":6,"id":"1027c0fc","metadata":{"execution":{"iopub.execute_input":"2024-06-06T13:52:19.211125Z","iopub.status.busy":"2024-06-06T13:52:19.209552Z","iopub.status.idle":"2024-06-06T13:52:19.230174Z","shell.execute_reply":"2024-06-06T13:52:19.228273Z"},"papermill":{"duration":0.032724,"end_time":"2024-06-06T13:52:19.23281","exception":false,"start_time":"2024-06-06T13:52:19.200086","status":"completed"},"tags":[]},"outputs":[],"source":["# Right now, we already train our model\n","# Let's predict car prices for data test set with our model\n","\n","Car_Price_Prediction = predict(linear_regression, newdata=testset)\n","\n","# Create df_merge to merge between actual car price and predicted car price\n","df_merge = cbind(testset, Car_Price_Prediction)"]},{"cell_type":"markdown","id":"cbcdaec9","metadata":{"papermill":{"duration":0.00784,"end_time":"2024-06-06T13:52:19.248464","exception":false,"start_time":"2024-06-0