21.071804","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["[1] \"Mean Absolute Error (MAE): 32.4819078237329\"\n"]}],"source":["# Mean Absolute Error\n","mae <- mean(abs(df_merge$Car_Price_Prediction - df_merge$Car_Price))\n","print(paste(\"Mean Absolute Error (MAE):\", mae))"]},{"cell_type":"markdown","id":"08de4337","metadata":{"papermill":{"duration":0.008646,"end_time":"2024-06-06T13:52:21.125044","exception":false,"start_time":"2024-06-06T13:52:21.116398","status":"completed"},"tags":[]},"source":["MAE = 32.48.\n","\n","This means that the model have average deviation from the true value by 32.48.\n","\n","Since the range of car prices between minimum and maximum is 402.82, the MAE value from model is relatively low.\n","\n","This information indicated that the model already performed well at car price prediction.\n"]},{"cell_type":"code","execution_count":9,"id":"69310f0f","metadata":{"execution":{"iopub.execute_input":"2024-06-06T13:52:21.146729Z","iopub.status.busy":"2024-06-06T13:52:21.145107Z","iopub.status.idle":"2024-06-06T13:52:21.165944Z","shell.execute_reply":"2024-06-06T13:52:21.163607Z"},"papermill":{"duration":0.035655,"end_time":"2024-06-06T13:52:21.16934","exception":false,"start_time":"2024-06-06T13:52:21.133685","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["[1] \"Root Mean Squared Error (RMSE): 52.2332029285474\"\n"]}],"source":["# Root Mean Square Error\n","rmse <- sqrt(mean((df_merge$Car_Price_Prediction - df_merge$Car_Price) ** 2))\n","print(paste(\"Root Mean Squared Error (RMSE):\", rmse))"]},{"cell_type":"markdown","id":"bcc0b404","metadata":{"papermill":{"duration":0.008795,"end_time":"2024-06-06T13:52:21.187114","exception":false,"start_time":"2024-06-06T13:52:21.178319","status":"completed"},"tags":[]},"source":["RMSE = 52.23.\n","\n","This means that the model have average deviation from the true value by 52.23.\n","\n","Since the range of car p